import React,{useState} from "react";

interface IState{
    message:string
}


const Youtube:React.FC = () => {
    const [state,setState] = useState<IState>({message:'NEW'});

    const handleTicket = (status:string):void => {
        setState({message:status})
    }
    return (
        <>
        <div className="row">
        <div className="col-md-6">
            <div className="card mt-4">
                <div className="card-body">
                    <h1 className="m3">{state.message}</h1>
                    {/* <button className="btn btn-danger">
                        New
                    </button> */}
                    <button className="btn btn-info ms-2" onClick={() => handleTicket('In-progress')}>
                        In-progress
                    </button>
                    <button className="btn btn-success ms-2"onClick={() => handleTicket('Resolved')}>
                        Resolved
                    </button>
                </div>
            </div>
        </div>
        </div>
            
        </>
    )


}

export default Youtube
